DROP TABLE IF EXISTS `eb_store_hospital`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `eb_store_hospital` (
  `id` mediumint(11) NOT NULL AUTO_INCREMENT COMMENT '医院id',
  `image` varchar(128) NOT NULL COMMENT '商品图片',
  `slider_image` varchar(512) NOT NULL COMMENT '轮播图',
  `store_name` varchar(128) NOT NULL COMMENT '商品名称',
  `store_info` varchar(256) NOT NULL COMMENT '商品简介',
  `keyword` varchar(256) NOT NULL COMMENT '关 键字',
  `city` varchar(256) NOT NULL COMMENT '所在城市',
  `region` varchar(256) NOT NULL COMMENT '所在地区',
  `location` varchar(256) NOT NULL COMMENT '具体位置',
  `longitude` decimal(8,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '经度',
  `latitude` decimal(8,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '纬度',
  `sales` mediumint(11) unsigned NOT NULL DEFAULT '0' COMMENT '销量',
  `is_show` tinyint(1) NOT NULL DEFAULT '1' COMMENT '状态（0：未上架，1：上架）',
  `description` text NOT NULL COMMENT '产品描述',
  `add_time` int(11) unsigned NOT NULL COMMENT '添加时间',
  `is_del` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '是否删除',
  `ficti` mediumint(11) DEFAULT '100' COMMENT '虚拟销量',
  `browse` int(11) DEFAULT '0' COMMENT '浏览量',
  `hospital_type` varchar(128) NOT NULL DEFAULT '',
  PRIMARY KEY (`id`),
  KEY `is_show` (`is_show`) USING BTREE,
  KEY `sales` (`sales`) USING BTREE,
  KEY `add_time` (`add_time`) USING BTREE
) ENGINE=MyISAM AUTO_INCREMENT=9 DEFAULT CHARSET=utf8 COMMENT='医院表';
/*!40101 SET character_set_client = @saved_cs_client */;

