INSERT INTO `eb_store_hospital` VALUES (1,'https://hospital.zhishekeji.com/public/uploads/attach/2019/04/16/5cb5eab108482.jpg','[\"https:\\/\\/hospital.zhishekeji.com\\/public\\/uploads\\/attach\\/2019\\/04\\/16\\/5cb5eab040786.jpg\",\"https:\\/\\/hospital.zhishekeji.com\\/public\\/uploads\\/attach\\/2019\\/04\\/16\\/5cb5eab01f254.jpg\"]','南京中医院','当时的','是对是错','上海','崇明区','将军大道545号',3.00,3.79,322,1,'<p>莆田学院附属医院是福建省最早的医院之一，创建于1896年（清光绪廿二年），前身系英国教会创办的“兴化圣教医院”，1912年改称“莆田圣路加医院”，1953年改名“莆田医院”，2003年升格为“莆田学院附属医院”，2009年挂牌“南方医科大学附属莆田医院”。2012年经市委、市政府批准成立“莆田学院附属医院医疗集团”，现已发展成为一所集医疗、教学、科研、急救、预防、康复、保健为一体的国家级三甲医院。现为国际紧急救援中心网络医院、国家级爱婴医院、全国综合医院中医药工作示范单位、福建省道路交通事故伤员救治定点医院</p><p></p>',1570113865,1,0,0,'公立三甲'),(2,'https://hospital.zhishekeji.com/public/uploads/attach/2019/04/16/5cb5eaafef223.jpg','[\"https:\\/\\/hospital.zhishekeji.com\\/public\\/uploads\\/attach\\/2019\\/04\\/16\\/5cb5eab040786.jpg\",\"https:\\/\\/hospital.zhishekeji.com\\/public\\/uploads\\/attach\\/2019\\/04\\/16\\/5cb5eab00cfda.jpg\",\"https:\\/\\/hospital.zhishekeji.com\\/public\\/uploads\\/attach\\/2019\\/04\\/16\\/5cb5eaafef223.jpg\"]','解放医院','的爽肤水','CT报告,挂号','南京','鼓楼','收到粉丝',3.22,3.46,23,1,'',1570171344,1,32,0,'私立医院'),(3,'https://hospital.zhishekeji.com/public/uploads/attach/2019/04/16/5cb5e81acefb0.jpg','[\"https:\\/\\/hospital.zhishekeji.com\\/public\\/uploads\\/attach\\/2019\\/04\\/16\\/5cb5e81a5274f.jpg\"]','溧水中医院','收到粉丝','三甲','南京','溧水','收到粉丝',1.00,1.00,100,1,'',1576903801,1,100,0,''),(4,'https://hospital.zhishekeji.com/public/uploads/attach/2019/04/16/5cb5e81acefb0.jpg','[\"https:\\/\\/hospital.zhishekeji.com\\/public\\/uploads\\/attach\\/2019\\/04\\/16\\/5cb5e81a5274f.jpg\"]','溧水中医院','收大大;sdfhifsfsd','三甲','南京','溧水','收到粉丝',1.00,1.00,100,1,'',1576907660,1,100,0,''),(5,'https://hospital.zhishekeji.com/public/uploads/attach/2019/04/16/5cb5e81acefb0.jpg','[\"https:\\/\\/hospital.zhishekeji.com\\/public\\/uploads\\/attach\\/2019\\/04\\/16\\/5cb5e81a5274f.jpg\"]','溧水中医院','收大大','三甲','南京','溧水','收到粉丝',1.00,1.00,100,1,'',1576908239,1,100,0,''),(6,'https://hospital.zhishekeji.com/public/uploads/attach/2019/04/16/5cb5e81acefb0.jpg','[\"https:\\/\\/hospital.zhishekeji.com\\/public\\/uploads\\/attach\\/2019\\/04\\/16\\/5cb5e81a5274f.jpg\"]','溧水中医院','收大大早上8:00-9:00','三甲','南京','溧水','收到粉丝',1.00,1.00,100,1,'',1576908853,1,100,0,''),(7,'https://hospital.zhishekeji.com/public/uploads/attach/2019/04/16/5cb5e81acefb0.jpg','[\"https:\\/\\/hospital.zhishekeji.com\\/public\\/uploads\\/attach\\/2019\\/04\\/16\\/5cb5e81a5274f.jpg\"]','溧水中医院','收大大;早上8:00-9:00','三甲','南京','溧水','收到粉丝',1.00,1.00,100,1,'',1576908857,1,100,0,''),(8,'https://hospital.zhishekeji.com/public/uploads/attach/2019/12/21/5dfdbd70c8337.jpg','[\"https:\\/\\/hospital.zhishekeji.com\\/public\\/uploads\\/attach\\/2019\\/12\\/21\\/5dfdbd70c8337.jpg\"]','莆田学院附属医院体检中心','早上8:00-下午4:00;晚上可预约','莆田学院附属医院,体检中心','莆田','荔城区','东圳东路999号莆田学院附属医院大楼5楼',119.02,25.45,89,1,'<p>莆田学院附属医院是福建省最早的医院之一，创建于1896年（清光绪廿二年），前身系英国教会创办的“兴化圣教医院”，1912年改称“莆田圣路加医院”，1953年改名“莆田医院”，2003年升格为“莆田学院附属医院”，2009年挂牌“南方医科大学附属莆田医院”。2012年经市委、市政府批准成立“莆田学院附属医院医疗集团”，现已发展成为一所集医疗、教学、科研、急救、预防、康复、保健为一体的国家级三甲医院。现为国际紧急救援中心网络医院、国家级爱婴医院、全国综合医院中医药工作示范单位、福建省道路交通事故伤员救治定点医院.</p>',1576910604,0,99,0,'公立三甲');
